import React, { Component } from 'react'
import PropTypes from 'prop-types'

class ThemeSwitch extends Component {
     render () {
        return(
            <div>
              <button>red</button>
              <button>blue</button>
            </div>
        )
     }
}
export default ThemeSwitch
